import React, { Fragment } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

import {
  Button, Card, CardBody, BlockQuote
} from 'reactstrap';

const MainCard = () => (
  <Fragment>
    <Card className="w-80">
      <FontAwesomeIcon icon="quote-left" />
      <CardBody>
        <BlockQuote className="w-50">something</BlockQuote>
        <Button color="success" className="font-weight-bold">Get New Quote</Button>
      </CardBody>
      <FontAwesomeIcon icon="quote-right" />
    </Card>

  </Fragment>
);

export default MainCard;
